import React from "react";
import "./header.css";
import logo from "../../images/haven-logo.jpg";

function Header() {
    return (
    <div className="container">
        <img src={logo} alt="Logo" />
        <h1> HAVEN </h1>
    </div>
    );
  }
  
  export default Header;
